var fs=require("fs");var common=require("./common");function _cd(b,a){if(!a){a=common.getUserHome()}if(a==="-"){if(!common.state.previousDir){common.error("could not find previous directory")}else{a=common.state.previousDir}}if(!fs.existsSync(a)){common.error("no such file or directory: "+a)}if(!fs.statSync(a).isDirectory()){common.error("not a directory: "+a)}common.state.previousDir=process.cwd();process.chdir(a)}module.exports=_cd;